#   Differential expression analysis with limma
library(Biobase)
library(GEOquery)
library(limma)

# load series GSE
gset <- getGEO("GSE38246", GSEMatrix =TRUE, AnnotGPL=FALSE)
if (length(gset) > 1) idx <- grep("GPL15615", attr(gset, "names")) else idx <- 1
gset <- gset[[idx]]

# Add metadata
fvarLabels(gset) <- make.names(fvarLabels(gset))

# Select samples: x-remove; 1-infected; 0-controls
gsms <- paste0("X1XXXX11XX01X011XX11XXXXXX1XX1X1XXX1X1X0X1XX101XX1",
               "XXXXXXXX10X0XX1XX11XXXX1XX1XX1X11X01X1XXXX1X1X1XXX",
               "1XXXXXXXXX0XX")
sml <- c()
for (i in 1:nchar(gsms)) { sml[i] <- substr(gsms,i,i) }

# eliminate samples marked as "X"
sel <- which(sml != "X")
sml <- sml[sel]
gset <- gset[ ,sel]

# log2 transform
ex <- exprs(gset)
qx <- as.numeric(quantile(ex, c(0., 0.25, 0.5, 0.75, 0.99, 1.0), na.rm=T))
LogC <- (qx[5] > 100) ||
  (qx[6]-qx[1] > 50 && qx[2] > 0) ||
  (qx[2] > 0 && qx[2] < 1 && qx[4] > 1 && qx[4] < 2)
if (LogC) { ex[which(ex <= 0)] <- NaN
exprs(gset) <- log2(ex) }

